import React, { Component, useState } from "react";

export default function Cards() {
	const [animals, setAnimals] = useState([
		{ type: "Lion" },
		{ type: "Rabbit" },
		{ type: "Wolf" }
	]);
	return (
		<div className="Cards">
			{animals.map((animal) => (
			<h1>{animal.type}</h1>
			))}
		</div>
	);
}
